import React from "react";
import { Github, Linkedin, Twitter, Mail, ExternalLink } from "lucide-react";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  const sections = [
    {
      title: "Core System",
      links: [
        { name: "Terminal Interface", url: "#" },
        { name: "Asset Management", url: "#" },
        { name: "Process Flows", url: "#" },
      ],
    },
    {
      title: "Organization",
      links: [
        { name: "Studio Policy", url: "#" },
        { name: "Directory", url: "#" },
        { name: "Support Hub", url: "#" },
      ],
    },
    {
      title: "Architecture",
      links: [
        { name: "Documentation", url: "#" },
        { name: "Changelog 2.0", url: "#" },
        { name: "System Log", url: "#" },
      ],
    },
  ];

  return (
    <footer className="w-full bg-white border-t border-[#111111] transition-colors">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 border-b border-[#111111]">
        {/* Brand Column */}
        <div className="p-12 border-b md:border-b-0 md:border-r border-[#111111] space-y-10">
          <div className="flex items-center gap-3">
            <div className="w-8 h-8 bg-[#111111] p-1.5">
              <img src="/logo1.png" alt="Logo" className="w-full h-full invert" />
            </div>
            <h2 className="text-xl font-black uppercase tracking-tighter text-[#111111]">Collabryta</h2>
          </div>

          <div className="space-y-4">
            <span className="swiss-label text-[#ff3e00] border-b border-[#ff3e00]">Statement/2025</span>
            <p className="text-xs font-bold leading-relaxed text-[#111111] uppercase tracking-widest max-w-[200px]">
              Modern tools for high-precision creative production and systemic collaboration.
            </p>
          </div>

          <div className="flex gap-4">
            {[Github, Twitter, Linkedin].map((Icon, i) => (
              <button key={i} className="p-2 border border-[#111111] hover:bg-[#111111] hover:text-white transition-all">
                <Icon size={16} />
              </button>
            ))}
          </div>
        </div>

        {/* Link Columns */}
        {sections.map((section, idx) => (
          <div key={section.title} className={`p-12 space-y-8 border-b md:border-b-0 ${idx < 2 ? 'lg:border-r border-[#111111]' : ''}`}>
            <h3 className="swiss-label border-b-2 border-[#111111] inline-block pb-1">{section.title}</h3>
            <ul className="space-y-4">
              {section.links.map((link) => (
                <li key={link.name}>
                  <a
                    href={link.url}
                    className="flex items-center justify-between text-[10px] font-bold uppercase tracking-[0.2em] text-[#111111] hover:text-[#ff3e00] transition-colors group"
                  >
                    {link.name}
                    <ExternalLink size={10} className="opacity-0 group-hover:opacity-100 transition-opacity" />
                  </a>
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>

      {/* Bottom Bar */}
      <div className="p-12 flex flex-col md:flex-row justify-between items-start md:items-center gap-8">
        <div className="space-y-2">
          <div className="text-[10px] font-black uppercase tracking-widest text-[#111111]">Â© {year} Collabryta Architectural Grid</div>
          <div className="text-[8px] font-mono font-bold text-zinc-400 uppercase tracking-tighter">All rights reserved to the system</div>
        </div>

        <div className="flex items-center gap-10">
          <div className="flex items-center gap-2">
            <div className="w-2 h-2 bg-[#ff3e00]" />
            <span className="text-[10px] font-mono font-bold uppercase tracking-widest">Typeface: Inter/Mono</span>
          </div>
          <div className="text-[10px] font-black uppercase tracking-widest text-zinc-500">
            Build Status: <span className="text-emerald-500">Stable</span>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
